import React from "react";
import { FaBars } from "react-icons/fa";

class List extends React.Component{
    render(){
        return(
            <div className="List">
                <header className="flex-column-nowrap">
                    <div className="flex-row-nowrap">
                        <FaBars/>
                        <form>
                            <input/>
                        </form>
                    </div>
                </header>
            </div>
        )
    }
}

export default List
